// This is easy:
function $(id) { return document.getElementById(id); }
function $g(m) {
	var mask = new RegExp(m);
	var r = mask.test(window.location.pathname);
//	alert('[mask]: ' + m + ' [res]: ' + res + ' [path]: ' + window.location.pathname);
	return r;
};
// --

// Applying style
function $a(w) {
	if (typeof GM_addStyle != 'undefined') {GM_addStyle(w)}
	else if (typeof addStyle != 'undefined') {addStyle(w)}
	else {
		var heads = document.getElementsByTagName('head');
		if (heads.length > 0)
			{
			var node = document.createElement('style');
				node.type = 'text/css';
				node.innerHTML = w;
			heads[0].appendChild(node); 
			};
		};
// --
};
